### Import Packages
"""

import torch

"""### Set Random Seed"""

import numpy as np
import random

SEED = 1234
random.seed(SEED)
np.random.seed(SEED)
torch.manual_seed(SEED)
torch.cuda.manual_seed(SEED)
torch.backends.cudnn.deterministic = True

"""### Set Parameters"""

epochs = 2
batch_size = 512
lr = 0.001

"""### Load Datasets

#### Data Transformations : Preprocessing of Raw Images

The pixel values of raw training and testing images in MNIST are between 0 and 255. To better fit our deep neural networks, normalization is needed to transform the pixel values into [-1,1]. In this section, we learn to use the `torchvision.transforms` for preprocessing of raw images. `torchvision.transforms` is also a convenient package for data augmentations like image cropping and rotation.
"""

import torchvision.transforms as transforms

# transforms.Compose is used to concatenate several transfomations together into one single variable.
transform = transforms.Compose([
    transforms.ToTensor(),
    transforms.Normalize(
        mean=[0.5, ],
        std=[0.5, ])
])

"""#### Load Dataset and Creat DataLoader

`torchvision.datasets` provides some widely used dataset in machine learning which can be directly downloaded by setting `download=True`. `torch.utils.data.DataLoader` can help you combine a dataset and a sampler, and provide an iterable over the given dataset.
"""

import torchvision.datasets as datasets
from torch.utils.data import DataLoader

data_train = datasets.MNIST(root='data/', transform=transform, train=True, download=True)
data_test = datasets.MNIST(root='data/', transform=transform, train=False)

dataloader_train = DataLoader(dataset=data_train, batch_size=batch_size, shuffle=True)
dataloader_test = DataLoader(dataset=data_test, batch_size=batch_size, shuffle=False)

