"""### Model Architecture

#### Define the Model with PyTorch API

Here we are going to use PyTorch Modular API to define a Convolutional Neural Network (CNN) model architecture. You need to define some architecture blocks in `__init__` and then complete the `forward` function. `torch.nn.Sequential` can help you merge APIs into sequential blocks. Please refer to https://pytorch.org/docs/stable/nn.html for detailed information about PyTorch Modular API.
"""

import torch.nn as nn
from torch.nn import Sequential

class CNN(nn.Module):
    def __init__(self):
        super(CNN, self).__init__()

        self.conv1 = Sequential(
            nn.Conv2d(in_channels=1, out_channels=64, kernel_size=3, stride=1, padding=1),
            nn.BatchNorm2d(64),
            nn.ReLU(),
            nn.MaxPool2d(kernel_size=2, stride=2)
        )

        self.conv2 = Sequential(
            nn.Conv2d(in_channels=64, out_channels=128, kernel_size=3, stride=1, padding=1),
            nn.BatchNorm2d(128),
            nn.ReLU(),
            nn.MaxPool2d(kernel_size=2, stride=2)
        )

        self.dense = Sequential(
            nn.Linear(7 * 7 * 128, 1024),
            nn.ReLU(),
            nn.Dropout(p=0.5),
            nn.Linear(1024, 10)
        )

    def forward(self, x):
        x1 = self.conv1(x)
        x2 = self.conv2(x1)
        x = x2.view(-1, 7 * 7 * 128)
        x = self.dense(x)
        return x

"""#### Call the Model

Remember to call the model after architecture define.
"""

cnn = CNN()

"""### Loss Function

Next, we need to define the loss function for the training process. Here we choose the Cross-Entropy loss. You can also try other loss functions like `torch.nn.MultiMarginLoss`.Refer to https://pytorch.org/docs/stable/nn.html#loss-functions for more details.
"""

loss_function = nn.CrossEntropyLoss()

"""### Optimization

Optimization method can also be easily defined by PyTorch. Here we use the Adam optimization method as an exampl, which is an advanced optimization method for gradient decent. You can also try the naive SGD by `torch.optim.SGD`. Remember to pass model parameters into the optimizer and set the learning rate.
"""

optimizer = torch.optim.Adam(cnn.parameters(), lr=lr)

"""### Training Process Visualization

To better monitor the training process of deep neural networks, we can try to visualize it by some exteral softwares like [TensorBoard](https://www.tensorflow.org/tensorboard) and [WandB](https://wandb.ai/site). Here we use TensorBoard as an example in the lecture.
"""

# Commented out IPython magic to ensure Python compatibility.
from torch.utils.tensorboard import SummaryWriter
writer = SummaryWriter('runs/cnn')
# %load_ext tensorboard
# %tensorboard --logdir=runs --port 1001

"""### Training and Evaluation

For each epoch of training and evaluation, we need to do an iteration through the training set and test set respectively.

#### Training Process
"""

def train(model, steps):
  training_loss = 0.0
  training_correct = 0.0

  model.train()
  for data, label in tqdm(dataloader_train):
      x_train, y_train = data, label
      outputs = model(x_train)
      _, pred = torch.max(outputs.data, 1)

      optimizer.zero_grad()
      loss = loss_function(outputs, y_train)
      loss.backward()
      optimizer.step()

      training_loss += loss.item()
      training_correct += torch.sum(pred == y_train.data)
      if steps%10==0:
        print("\n Train Loss: {:.4f}  Train Accuracy: {:.4f}%".format(
      loss.item(), training_correct/len(y_train.data)))
        writer.add_scalar('train_loss',loss.item(),steps)
        writer.add_scalar('train_acc',torch.sum(pred == y_train.data)/len(y_train.data),steps)
      steps+=1
  return training_loss, training_correct, steps

"""#### Evaluation"""

def evaluation(model):
  model.eval()
  testing_correct = 0.0
  for data in dataloader_test:
      x_test, y_test = data
      outputs = model(x_test)
      _, pred = torch.max(outputs, 1)
      testing_correct += torch.sum(pred == y_test.data)
  return testing_correct

"""#### Start Training"""

from tqdm import tqdm

steps = 0
for epoch in range(epochs):
  print("Epoch [{}/{}]".format(epoch, epochs))
  training_loss, training_correct, steps = train(cnn, steps)
  testing_correct = evaluation(cnn)
  print("Loss: {:.4f}  Train Accuracy: {:.4f}%  Test Accuracy: {:.4f}%".format(
      training_loss / len(data_train), 100 * training_correct / len(data_train),
      100 * testing_correct / len(data_test)))